import React from "react";
import { Page, Text, Viewer, Document } from '@react-pdf/renderer';
import {
  RPConfig,
  RPProvider,
  RPDefaultLayout,
  RPPages,} from "@pdf-viewer/react";

function LectionPage() {
  return (
    <div>
      <Document file={'/test.pdf'}>
        <Page size="A4" />
      </Document>
    </div>
  );
}

export default LectionPage;
